func TestFindNumberWithWorkers(t *testing.T) {

	t.Logf("len: %d\n", len(mySlice))

	// tutorial.FindNumberWithWorkers(mySlice, 4958)
	assert := assert.New(t)
	var tests = []struct {
		target   int
		timeout  time.Duration
		expected bool
	}{
		{4958, time.Second, true},
		{49058, time.Second, false},
		{9593, time.Second, true},
		{92593, time.Second * 10, false},
	}
	for _, test := range tests {
		// result := tutorial.FindNumberWithWorkers(mySlice, test.target)
		result := tutorial.FindNumberWithWorkersAndTimeout(mySlice, test.target, test.timeout)
		fmt.Printf("find %d : %v \n", test.target, result)
		assert.Equal(result, test.expected)
	}
}

func TestFind(t *testing.T) {
	convey.Convey("TestFind should return true\n", t, func() {
		convey.So(tutorial.FindNumberWithWorkers(mySlice, 4958), convey.ShouldBeTrue)
	})
}
